import React, { Component } from "react";
import MuiFooter from '@material-ui/core/Footer';

class Footer extends Component {
  render() {
      return (
        <Muifooter color="primary">Esse é um projeto protótipo feito como forma de avaliação pela Vizir
        </Muifooter>
    );
  }
}

export default Footer;
